import React from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";
import './NavigationLandingPage.css';
import { Navbar, Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button } from 'react-bootstrap';

function NavigationLandingPage() {
    return (
        <Navbar default collapseOnSelect>
            <Router>
            <Link to="/signup"><button className="sign-up">SIGN UP</button></Link>
            <Link to="/signin"><button className="sign-in">SIGN IN</button></Link>
            </Router>
        </Navbar>



    );
}

export default NavigationLandingPage;
